DROP TABLE SYS_OSS;
CREATE TABLE SYS_OSS (ID NUMBER(20) NOT NULL, URL NVARCHAR2(200), CREATE_DATE DATE, PRIMARY KEY (ID));
COMMENT ON TABLE SYS_OSS IS '文件上传';
COMMENT ON COLUMN SYS_OSS.URL IS 'URL地址';
COMMENT ON COLUMN SYS_OSS.CREATE_DATE IS '创建时间';
DROP TABLE SYS_ROLE;
CREATE TABLE SYS_ROLE (ROLE_ID NUMBER(20) NOT NULL, ROLE_NAME NVARCHAR2(100), REMARK NVARCHAR2(100), DEPT_ID NUMBER(20), CREATE_TIME DATE, PRIMARY KEY (ROLE_ID));
COMMENT ON TABLE SYS_ROLE IS '角色';
COMMENT ON COLUMN SYS_ROLE.ROLE_NAME IS '角色名称';
COMMENT ON COLUMN SYS_ROLE.REMARK IS '备注';
COMMENT ON COLUMN SYS_ROLE.DEPT_ID IS '部门ID';
COMMENT ON COLUMN SYS_ROLE.CREATE_TIME IS '创建时间';
DROP TABLE SYS_ROLE_DEPT;
CREATE TABLE SYS_ROLE_DEPT (ID NUMBER(20) NOT NULL, ROLE_ID NUMBER(20), DEPT_ID NUMBER(20), PRIMARY KEY (ID));
COMMENT ON TABLE SYS_ROLE_DEPT IS '角色与部门对应关系';
COMMENT ON COLUMN SYS_ROLE_DEPT.ROLE_ID IS '角色ID';
COMMENT ON COLUMN SYS_ROLE_DEPT.DEPT_ID IS '部门ID';
DROP TABLE SYS_ROLE_MENU;
CREATE TABLE SYS_ROLE_MENU (ID NUMBER(20) NOT NULL, ROLE_ID NUMBER(20), MENU_ID NUMBER(20), PRIMARY KEY (ID));
COMMENT ON TABLE SYS_ROLE_MENU IS '角色与菜单对应关系';
COMMENT ON COLUMN SYS_ROLE_MENU.ROLE_ID IS '角色ID';
COMMENT ON COLUMN SYS_ROLE_MENU.MENU_ID IS '菜单ID';
DROP TABLE SYS_USER;
CREATE TABLE SYS_USER (USER_ID NUMBER(20) NOT NULL, USERNAME NVARCHAR2(50) NOT NULL, PASSWORD NVARCHAR2(100), SALT NVARCHAR2(20), EMAIL NVARCHAR2(100), MOBILE NVARCHAR2(100), STATUS NUMBER(4), DEPT_ID NUMBER(20), CREATE_TIME DATE, PRIMARY KEY (USER_ID));
COMMENT ON TABLE SYS_USER IS '系统用户';
COMMENT ON COLUMN SYS_USER.USERNAME IS '用户名';
COMMENT ON COLUMN SYS_USER.PASSWORD IS '密码';
COMMENT ON COLUMN SYS_USER.SALT IS '盐';
COMMENT ON COLUMN SYS_USER.EMAIL IS '邮箱';
COMMENT ON COLUMN SYS_USER.MOBILE IS '手机号';
COMMENT ON COLUMN SYS_USER.STATUS IS '状态  0：禁用   1：正常';
COMMENT ON COLUMN SYS_USER.DEPT_ID IS '部门ID';
COMMENT ON COLUMN SYS_USER.CREATE_TIME IS '创建时间';
CREATE UNIQUE INDEX USERNAME ON SYS_USER (USERNAME);
DROP TABLE SYS_USER_ROLE;
CREATE TABLE SYS_USER_ROLE (ID NUMBER(20) NOT NULL, USER_ID NUMBER(20), ROLE_ID NUMBER(20), PRIMARY KEY (ID));
COMMENT ON TABLE SYS_USER_ROLE IS '用户与角色对应关系';
COMMENT ON COLUMN SYS_USER_ROLE.USER_ID IS '用户ID';
COMMENT ON COLUMN SYS_USER_ROLE.ROLE_ID IS '角色ID';
DROP TABLE SYS_WAY;
CREATE TABLE SYS_WAY (WAY_NO NVARCHAR2(6) NOT NULL, WAY_NAME NVARCHAR2(80), LEV NVARCHAR2(1), UPLEV NVARCHAR2(6), PRIMARY KEY (WAY_NO));
CREATE INDEX CIF_WAY_IDX1 ON SYS_WAY (UPLEV);
DROP TABLE TB_TOKEN;
CREATE TABLE TB_TOKEN (USER_ID NUMBER(20) NOT NULL, TOKEN NVARCHAR2(100) NOT NULL, EXPIRE_TIME DATE, UPDATE_TIME DATE, PRIMARY KEY (USER_ID));
COMMENT ON TABLE TB_TOKEN IS '用户Token';
COMMENT ON COLUMN TB_TOKEN.TOKEN IS 'token';
COMMENT ON COLUMN TB_TOKEN.EXPIRE_TIME IS '过期时间';
COMMENT ON COLUMN TB_TOKEN.UPDATE_TIME IS '更新时间';
CREATE UNIQUE INDEX TOKEN ON TB_TOKEN (TOKEN);
DROP TABLE TB_USER;
CREATE TABLE TB_USER (USER_ID NUMBER(20) NOT NULL, USERNAME NVARCHAR2(50) NOT NULL, MOBILE NVARCHAR2(20) NOT NULL, PASSWORD NVARCHAR2(64), CREATE_TIME DATE);
COMMENT ON TABLE TB_USER IS '用户';
COMMENT ON COLUMN TB_USER.USERNAME IS '用户名';
COMMENT ON COLUMN TB_USER.MOBILE IS '手机号';
COMMENT ON COLUMN TB_USER.PASSWORD IS '密码';
COMMENT ON COLUMN TB_USER.CREATE_TIME IS '创建时间';
DROP TRIGGER TRI_DATA_SOURCE;
--/
CREATE TRIGGER TRI_DATA_SOURCE
  before insert on DATA_SOURCE
  for each row
declare
  nextid number;
begin
  IF :new.ID IS NULL or :new.ID=0 THEN
    select SEQ_DATA_SOURCE.nextval
    into nextid
    from sys.dual;
    :new.ID:=nextid;
  end if;
end tri_data_source;

